// ==UserScript==
// @name			cctubes caption requests
// @version			1.1
// @author			J
// @description 	modifies cctubes tool page
// @match 			https://cctubes.com/caption-requests/
// @require  		https://ajax.googleapis.com/ajax/libs/jquery/3.3.1/jquery.min.js
// @grant			GM_log
// @run-at      	document-idle
// ==/UserScript==

var $ = window.jQuery;

(() => {

    const app = {

        /*
         * Notification
         * Play a sound notification
         */

        notification() {
            var base64text = '';
            var sound = new Audio("data:audio/wav;base64," + base64text);
            sound.play();
        },

        /*
         * Available Videos Number
         * cctubes has a bug where it always displays an extra 1 available video when there isn't, this fixes it
         * also sends a notification when there is a claimable video
         */

        changeAvailable() {
            //var available = $('.container>.row:nth-of-type(2) .dash-container .col-sm-12 strong').text();
            //available = parseInt(available - 0);

            //$('.container>.row:nth-of-type(2) .dash-container .col-sm-12 strong').text(available);

            const available = document.querySelectorAll('.container > .row:nth-of-type(2) tbody tr').length;
            $('.container>.row:nth-of-type(2) .dash-container .col-sm-12 strong').text(available);

            if (available > 0) {
                this.notification();
            }

            $('title').text('(' + available + ') Caption Requests');
        },

        /*
         * Claimed Videos Number
         * shows how many of the claimed videos you have already done
         */

        changeClaimed() {
            var claimed = parseInt($('.container>.row:nth-of-type(3) .dash-container .col-sm-12 strong').text()) - 0;
            //var submitted = parseInt($('.container>.row:nth-of-type(4) .dash-container .col-sm-6 strong').text()) - 0;
            const submitted = document.querySelectorAll('.cr-submitted').length;

            $('.container>.row:nth-of-type(3) .dash-container .col-sm-12 strong').text(submitted + ' of ' + claimed);
            $('.container>.row:nth-of-type(3) .dash-container .col-sm-12 span').text('VIDEOS');
        },

        /*
         * Change Button Texts
         * makes some changes to the texts of the buttons
         */
        changeButtons() {
            $('#tabledata .btn-success').each((i, elem) => {
                $(elem).html('<i class="fa fa-plus"></i>');
            });
            $('#tabledata2 .btn-success').each((i, elem) => {
                $(elem).html('<i class="fa fa-pencil"></i>');
            });
            $('#tabledata2 .btn-danger').each((i, elem) => {
                $(elem).html('<i class="fa fa-ban"></i>');
            });
        },

        /*
         * Indicate Submitted Videos
         * Claimed videos that have been worked on and submitted will be highlighted
         */

        indicateSubmitted() {
            var submitted = [];
            var title, found;

            $('.container>.row:nth-of-type(4) table tbody tr').each((i, e) => {
                title = $(e).find('td:nth-of-type(2)').text().replace(/[^\w\s]/gi, '');
                submitted.push(title);
            });

            $('.container>.row:nth-of-type(3) table tbody tr').each((i, e) => {
                title = $(e).find('td:nth-of-type(3)').text().replace(/[^\w\s]/gi, '');
                found = submitted.includes(title);
                if (found == true) {
                    $(e).addClass('cr-submitted');
                }
            });
        },

        start() {
            this.changeAvailable();
            this.changeButtons();
            this.indicateSubmitted();
            this.changeClaimed();
        }

    }

    app.start();



})();